import React from 'react'
import './Home.css'

import {uploads} from '../../utils/config'

//Hooks
import { useSelector, useDispatch } from 'react-redux';
import { useState, useEffect } from 'react';

//Redux
import { listGames } from '../../slices/gameSlice';

const Home = () => {
  const dispatch = useDispatch();

  const {games, message, error, loading} = useSelector((state) => state.game);

  const [gameList, setGameList] = useState("");

  useEffect(() => {
    dispatch(listGames());
    console.log(games);
  }, [dispatch]);

  useEffect(() => {
    if(games) {
      setGameList(games);
      console.log("Lista de jogos:", games.data);
    }
  }, [games]);

  return (
    <div id='home'>
      <div className='homepage-infowindow'>
        <img className="homepage-image" src={`${uploads}/homepage_image/homepage_image.png`} alt={"homepage_image"}/>
        <h2 className='homepage-title'>Encontre a parceria de gameplay ideal</h2>
      </div>
      <div className='game-list'>

      </div>
    </div>
  )
}

export default Home
